                    </div>
                    <div class="fadein clearfix colelem shared_content" id="u23885-4" data-content-guid="u23885-4_content"><!-- content -->
                        <p>Our instructors are DDS licensed, patient and knowledgeable at teaching new and nervous drivers. We teach all drivers of ages from 15 to 95 years young.&nbsp; We specialize on international drivers too. Courtesy pick-up for each driving lesson and road testing. Learn with the best instructors in the field.</p>
